import React from 'react';
import {Drawer ,List, ListItem, ListItemIcon, ListItemText} from '@material-ui/core';

import HomeIcon from '@material-ui/icons/Home'

const HeaderMenu= () => {

  return (
    <div>
        <Drawer
        variant="temporary"
        anchor="left"
        open={true}>
            <list>
                <listItem>
                    <ListItemIcon>
                        <HomeIcon />
                    </ListItemIcon>
                </listItem>
            </list>
        </Drawer>
    </div>
  );
}
export default HeaderMenu
